DECLARE

	-- Identificador de un formato
	nuFormatId          ed_formato.formcodi%type;

BEGIN
--{
	if ( not CONFEXME_40.boProcessStatusOK ) then
	--{
		-- No realiza nada
		return;
	--}
	end if;

	-- Se obtiene código del formato con el identificador especificado
	open CONFEXME_40.cuFormat( 203 );
	fetch CONFEXME_40.cuFormat into nuFormatId;
	close CONFEXME_40.cuFormat;

	-- Se verifica si existe un formato con el delimitador especificado, en cuyo caso se elimina
	if ( nuFormatId is not NULL ) then
	--{
		-- Se establece el identificador para el formato
		CONFEXME_40.rcED_Formato.formcodi := nuFormatId;

		-- Se actualiza la información del formato
		UPDATE ED_Formato
		SET    formdesc = 'LDC_FACTURA_CONSTRUCTORAS',
		       formtido = 66,
		       formiden = '<203>',
		       formtico = 576,
		       formdein = '<LDC_CONSTRUCTORAS>',
		       formdefi = '</LDC_CONSTRUCTORAS>'
		WHERE  formcodi = CONFEXME_40.rcED_Formato.formcodi;
	--}
	else
	--{
		-- Se genera un identificador para el formato
		CONFEXME_40.rcED_Formato.formcodi := 203 ;

		-- Se inserta el formato
		INSERT INTO ED_Formato
		(
			formcodi,
			formdesc,
			formtido,
			formiden,
			formtico,
			formdein,
			formdefi
		)
		VALUES
		(
			CONFEXME_40.rcED_Formato.formcodi,
			'LDC_FACTURA_CONSTRUCTORAS',
			66,
			'<203>',
			576,
			'<LDC_CONSTRUCTORAS>',
			'</LDC_CONSTRUCTORAS>'
		);
	--}
	end if;

EXCEPTION

	when OTHERS then
		CONFEXME_40.boProcessStatusOK := FALSE;
		ROLLBACK;
		UT_Trace.Trace( 'ERROR -> ' || sqlerrm, 5 );
		raise;
--}
END;
