DECLARE

	-- Almacena el valor generado por una secuencia
	nuNextSeqValue       number;

	-- CLOBS correspondientes a la definición de las columnas de la sentencia
	clWizardColumns      clob;
	clSelectColumns      clob;
	clListValues         clob;

BEGIN
--{
	if ( not CONFEXME_40.boProcessStatusOK ) then
	--{
		-- No realiza nada
		return;
	--}
	end if;

	-- Se genera un identificador para la sentencia
	nuNextSeqValue := GE_BOSequence.NextGe_Statement;
	CONFEXME_40.tbrcGE_Statement( '120165418' ).statement_id := nuNextSeqValue;

	UT_Trace.Trace( 'Insertando Sentencia [LDC - Obtener Codigo de Barras]', 5 );
	INSERT INTO GE_Statement
	(
		statement_id,
		module_id,
		description,
		statement,
		name
	)
	VALUES
	(
		CONFEXME_40.tbrcGE_Statement( '120165418' ).statement_id,
		21,
		'LDC - Obtener Codigo de Barras',
		'SELECT /*+ ORDERED*/
''415''||dald_parameter.fsbGetValue_Chain(''COD_EAN_CODIGO_BARRAS'')
||''8020''||lpad(cuponume,10,''0'')||chr(200)||
''3900''||lpad(round(cupovalo),10,''0'')||chr(200)||''96''||to_char(cucofeve, ''yyyymmdd'') CODE,
NULL IMAGE
from open.factura, open.cupon, open.cuencobr
where factcodi= cupodocu
AND cuponume = open.LDC_BOFORMATOFACTURA.fnuGetNumCupon(factcodi,factsusc)
AND factcodi = obtenervalorinstancia(''FACTURA'',''FACTCODI'')
and cucofact=factcodi
AND rownum = 1',
		'LDC - Obtener Codigo de Barras'
	);

	INSERT INTO GE_Statement_Columns VALUES
	(
		CONFEXME_40.tbrcGE_Statement( '120165418' ).statement_id,
		empty_clob(),
		empty_clob(),
		empty_clob()
	)
	RETURNING	wizard_columns, select_columns, list_values
	INTO		clWizardColumns, clSelectColumns, clListValues;

	dbms_lob.append( clSelectColumns, '<?xml version="1.0" encoding="utf-16"?>
<ArrayOfBaseStatementColumn xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance" xmlns:xsd="http://www.w3.org/2001/XMLSchema">
  <BaseStatementColumn>
    <Name>CODE</Name>
    <Description>CODE</Description>
    <DisplayType>2</DisplayType>
    <InternalType>2</InternalType>
    <Length>4000</Length>
    <Scale>0</Scale>
  </BaseStatementColumn>
  <BaseStatementColumn>
    <Name>IMAGE</Name>
    <Description>IMAGE</Description>
    <DisplayType>2</DisplayType>
    <InternalType>2</InternalType>
    <Length>2</Length>
    <Scale>0</Scale>
  </BaseStatementColumn>
</ArrayOfBaseStatementColumn>' );

EXCEPTION

	when OTHERS then
		CONFEXME_40.boProcessStatusOK := FALSE;
		ROLLBACK;
		UT_Trace.Trace( 'ERROR -> ' || sqlerrm, 5 );
		raise;
--}
END;
