	nuNextSeqValue      number;

BEGIN
--{
	if ( not CONFEXME_40.boProcessStatusOK ) then
	--{
		-- No realiza nada
		return;
	--}
	end if;

	-- Se genera un identificador para el item-bloque
	nuNextSeqValue := pkBOInsertMgr.NextED_ITEMBLOQ;
	CONFEXME_40.tbrcED_ItemBloq( '55960' ).itblcodi := nuNextSeqValue;

	-- Se asigna el bloque-franja
	CONFEXME_40.tbrcED_ItemBloq( '55960' ).itblblfr := CONFEXME_40.tbrcED_BloqFran( '8319' ).blfrcodi;

	-- Se asigna el item
	if ( CONFEXME_40.tbrcED_Item.exists( '55926' ) ) then
		CONFEXME_40.tbrcED_ItemBloq( '55960' ).itblitem := CONFEXME_40.tbrcED_Item( '55926' ).itemcodi;
	end if;

	INSERT INTO ED_ItemBloq
	(
		itblcodi,
		itblitem,
		itblblfr,
		itblorde
	)
	VALUES
	(
		CONFEXME_40.tbrcED_ItemBloq( '55960' ).itblcodi,
		CONFEXME_40.tbrcED_ItemBloq( '55960' ).itblitem,
		CONFEXME_40.tbrcED_ItemBloq( '55960' ).itblblfr,
		6
	);

EXCEPTION

	when OTHERS then
		CONFEXME_40.boProcessStatusOK := FALSE;
		ROLLBACK;
		UT_Trace.Trace( 'ERROR -> ' || sqlerrm, 5 );
		raise;
--}
END;
